import React, { useState } from 'react'
import Ai from './Ai'
import User from './User'


function ContainerMsg([message]) {



  return ( 
    <div  className='flex flex-col mt-5'>
      <Ai />
      <User />

      { message && message.map((index) => {
        <Ai key={index}/>
      }) }



    </div>
  )
}

export default ContainerMsg
